import { Component } from "react";

class LoginA extends Component{
    render(){
        return(
            <>
                
                       
                                <button
                                    className="btn btn-success float-end text-white"
                                    type="submit"
                                >
                                    Login
                                </button>
                                
                           
            </>
        );
    }
}
export default LoginA;
